import { Container } from "@mui/material";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";

const Banner = () => {
  return (
    <Container>
      <Toolbar>
        <Typography variant="h1">Welcome To Dompet Santri</Typography>
      </Toolbar>
    </Container>
  );
};

export default Banner;
